// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract HistoriaClinica {
    // Estructura de datos para la informacion de un paciente
    struct Paciente {
        uint256 id;
        string nombre;
        uint256 edad;
        string diagnostico;
        address medico;
        bool autorizado;
    }

    // Mapping que relaciona la direccion del paciente con su informacion
    mapping(address => Paciente) public pacientes;

    // Evento que se emite cuando se agrega un nuevo paciente a la historia clinica
    event PacienteAgregado(
        address indexed paciente,
        string nombre,
        uint256 edad,
        string diagnostico,
        address medico
    );

    // Modificador para restringir el acceso solo a medicos autorizados
    modifier soloMedicosAutorizados() {
        require(
            pacientes[msg.sender].autorizado,
            "Solo los medicos autorizados pueden acceder a esta informacion."
        );
        _;
    }

    // Funcion para agregar un nuevo paciente a la historia clinica
    function agregarPaciente(
        address _paciente,
        string memory _nombre,
        uint256 _edad,
        string memory _diagnostico
    ) public {
        // Verificar que el paciente no este registrado
        require(
            pacientes[_paciente].id == 0,
            "El paciente ya esta registrado en la historia clinica."
        );

        // Obtener el ID del nuevo paciente
        uint256 nuevoId = uint256(
            keccak256(abi.encodePacked(block.timestamp, _paciente))
        );

        // Crear la nueva estructura de datos del paciente
        Paciente memory nuevoPaciente = Paciente({
            id: nuevoId,
            nombre: _nombre,
            edad: _edad,
            diagnostico: _diagnostico,
            medico: msg.sender,
            autorizado: true
        });

        // Agregar el nuevo paciente al mapping
        pacientes[_paciente] = nuevoPaciente;

        // Emitir el evento de paciente agregado
        emit PacienteAgregado(
            _paciente,
            _nombre,
            _edad,
            _diagnostico,
            msg.sender
        );
    }

    // Funcion para obtener la informacion de un paciente
    function obtenerInformacionPaciente(
        address _paciente
    )
        public
        view
        soloMedicosAutorizados
        returns (uint256, string memory, uint256, string memory)
    {
        // Verificar que el paciente este registrado
        require(
            pacientes[_paciente].id != 0,
            "El paciente no esta registrado en la historia clinica."
        );

        // Obtener la informacion del paciente y retornarla
        Paciente memory paciente = pacientes[_paciente];
        return (
            paciente.id,
            paciente.nombre,
            paciente.edad,
            paciente.diagnostico
        );
    }

    // Funcion para actualizar el diagnostico de un paciente
    function actualizarDiagnostico(
        address _paciente,
        string memory _diagnostico
    ) public soloMedicosAutorizados {
        // Verificar que el paciente este registrado
        require(
            pacientes[_paciente].id != 0,
            "El paciente no esta registrado en la historia clinica."
        );

        // Actualizar el diagnostico del paciente
        pacientes[_paciente].diagnostico = _diagnostico;
    }

    function isDoctor(address _medico) public view returns (bool) {
        return pacientes[_medico].autorizado;
    }

    // Funcion para autorizar a un medico para acceder a la informacion de un paciente
    function autorizarMedico(
        address _medico,
        address _paciente
    ) public soloMedicosAutorizados {
        // Verificar que el paciente
        require(
            pacientes[_paciente].id != 0,
            "El paciente no esta registrado en la historia clinica."
        );

        // Autorizar al medico para acceder a la informacion del paciente
        pacientes[_paciente].autorizado = true;
    }

    // Funcion para revocar la autorizacion de un medico para acceder a la informacion de un paciente
    function revocarAutorizacionMedico(
        address _medico,
        address _paciente
    ) public soloMedicosAutorizados {
        // Verificar que el paciente este registrado y que el medico este autorizado
        require(
            pacientes[_paciente].id != 0,
            "El paciente no esta registrado en la historia clinica."
        );
        require(
            pacientes[_paciente].medico == _medico,
            "El medico no esta autorizado para acceder a la informacion del paciente."
        );

        // Revocar la autorizacion del medico para acceder a la informacion del paciente
        pacientes[_paciente].autorizado = false;
    }
}
